import Card from "../UI/Card";
import "./TaskList.css";
import Button from "../UI/Button";

const TaskList = (props) => {
    
    return(
            <Card className="list-container">
                <p>{props.title}</p>
                <Button onClick={props.deleteTask}>Delete</Button>
            </Card>
    );
}

export default TaskList;
